y contains key \"Message\" and value \"Employee Created\"\r\n    And the employee id \"Employee.employee_id\" is stored as global to be used for other request\r\n\r\n\r\n  @apidynamic\r\n  Scenario: API test case for creating the employee using highly dynamic body\r\n    Given a request is prepared for creating an employee with dynamic data \"Aram\", \"Lango\", \"ms\", \"M\", \"2010-01-14\", \"confirmed\", \"QA Engineer\"\r\n    When a POST call is made to create an employee\r\n    Then the status code for creating an employee is 201\r\n    And the response body contains key \"Message\" and value \"Employee Created\"\r\n    And the employee id \"Employee.employee_id\" is stored as global to be used for other request\r\n\r\n\r\n  @apidynamic\r\n  Scenario: API test case for updating the created employee using highly dynamic body\r\n    Given a request is prepared for updating the created employee with dynamic data \"empId\", \"Yuza\", \"Wali\", \"ms\", \"F\", \"2023-01-15\", \"Maternity-leave\", \"Manager\"\r\n    When a PUT call is made to update the created employee\r\n    Then the status code for creating an employee is 200\r\n    And the response body contains key \"Message\" and value \"Employee record Updated\"\r\n    And the employee id \"Employee.employee_id\" is stored as global to be used for other request\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/PC/IdeaProjects/CucumberBatch14/src/test/resources/features/APIWorkflow.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"API workflow test","children":[{"background":{"location":{"line":3,"column":3},"keyword":"Background","name":"for generating the token before every request","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","text":"a JWT is generated","id":"f5bb0e5e-0abc-4951-8212-52fae1552435"}],"id":"d6a97743-1982-41b4-8d70-e7dfac346dcc"}},{"scenario":{"location":{"line":7,"column":3},"tags":[{"loca
